import React from "react";
import styles from './Header.module.css';

const Header = (props) =>{

    const navBar = [
        {
            id_num:1,
            id: "baligya",
            path: '/baligya',
            li: "Baligya",
        },
        {
            id_num:2,
            id: "register",
            path: '/register',
            li: "Register",
        },
        {
            id_num:3,
            id: "login",
            path: '/login',
            li: "Login",
        },
    ]

    return(
        <div className={`${styles.container}`}>
            <ul className={`${styles.nav}`}>
                <li>Baligya</li>
                <li>Register</li>
                <li>Login</li>
            </ul>
        </div>
    );
}

export default Header;
